import React, { Component } from 'react';
import { BrowserRouter, Route, Switch } from 'react-router-dom';

import './App.css';
import Navbar from './component/Navbar'
import Body from './component/Body'
import Herobanner from './component/Herobanner'

function App() {
  return (
    <div className="App">
      <Navbar />
      <Herobanner />
      <Body />
    </div>
  );
}

export default App;
